import React from 'react'
import BootstrapTable from 'react-bootstrap-table-next';

export default function BookTable() {

    const columns = [{
        dataField: 'id',
        text: 'Product ID'
    }, {
        dataField: 'name',
        text: 'Product Name'
    }, {
        dataField: 'price',
        text: 'Product Price'
    }];


    const products= [{
    id:1,
    name: 'Livro 1',
    price: 10
    },
        {
            id:2,
            name: 'Livro 2',
            price: 50
        },
        {
            id:1,
            name: ' 3',
            price: 100
        }
]
    

    return (
        <div>
            <BootstrapTable keyField='id' data={products} columns={columns} />
        </div>
    )
}
